import React from 'react'

function AdminCharts(props) {
    return (
        <>
            <div className="adminChartBody">
                <div className="adminChartImg">
                    <img src={props.imgsrc} alt=""/>
                </div>
            </div>
        </>
    )
}

export default AdminCharts
